import React, { useState } from "react";

const Clothing = ({ label, imageUrl }) => {
    const [isChecked, setIsChecked] = useState(false);
  return (
    <>
      <label htmlFor="clothing_item" className={`w-24 flex flex-col items-center cursor-pointer ${isChecked ? "border border-green-400" : ""}`}>
        <img src={imageUrl} alt={label} />
        <p>{label}</p>
      </label>
      <input type="checkbox" id="clothing_item" className="hidden" />
    </>
  );
};

export default Clothing;
